script: |
  super -f text -I q4068.spq | sort > q4068.out

inputs:
  - name: q4068.spq
    data: |
      SELECT DISTINCT + + col1 * ( - col0 ) / + + 17 - + col2 AS col1, - col1 AS col2 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q4068.out
    data: |
      -161	-51
      -329	-77
      -353	-67
